import logo from './logo.svg';
import './App.css';



function App() {
  return (
    <div className="App">
      <header>
        <img src='https://img.freepik.com/free-psd/logo-mockup-grey-wall_35913-2100.jpg?t=st=1652183629~exp=1652184229~hmac=1bea56592042ed2646f30de61bbf85e0b8b7e239f6beecd5d63f1255bb24f37f&w=1800' width='100px' height='100px'/>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>Feed</div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}

export default App;
